// Enrollment.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import CustomButton from '../Components/Button.jsx';
import TitleSubtitle from '../Components/TitleSubtitle.jsx'; // Importez le composant TitleSubtitle

function Enrollment() {
  return (
    <div>
      {/* Bouton Retour avec icône */}
      <Link to="/Home">
        <CustomButton variant="back">
          <img src="back_icon.png" alt="Retour" />
        </CustomButton>
      </Link>

      {/* Titre et sous-titre */}
      <TitleSubtitle title="Enroler" subtitle="les contribuables" />

      {/* Formulaire d'enrôlement */}
      <form>
        <div>
          <input type="text" placeholder="Nom et prénom*" />
        </div>
        <div>
          <input type="text" placeholder="Raison sociale" />
        </div>
        {/* Ajoutez plus d'inputs si nécessaire */}
        <CustomButton variant="submit">Soumettre</CustomButton>
      </form>
    </div>
  );
}

export default Enrollment;
